import { Container } from "@mui/material";
import { Box } from "@mui/system";

export default function Support() {
  return (
    <Container>
      <Box
        sx={{
          marginTop: 3,
          marginBottom: 3,

          display: "flex",
          flexDirection: "column",
        }}
      >
        <p>Let us know about any problems / bugs in the application.</p>
      </Box>
    </Container>
  );
}
